import React from "react";
import { Link } from "react-router-dom";
import './landing.css'; // Import the CSS file

const LandingPage = () => {
  return (
    <div style={{width: '100vw', height: '100vh', position: 'relative', background: '#FFF6EC', overflow: 'hidden'}}>
   <div
  style={{
    textAlign: 'right',
    justifyContent: 'center',
    display: 'flex',
    flexDirection: 'column',
    color: '#FF5501',
    fontSize: '30px',
    fontFamily: 'Arial',
    fontWeight: '700',
    wordWrap: 'break-word',
    padding: '20px',
  }}
>
  <Link
    to="/login"
    style={{
      color: '#FF5501', // Make sure the link has the same color
      textDecoration: 'none', // Remove underline
      fontSize: '30px', // Set font size for the link
      fontWeight: '700', // Same weight as the parent
      transition: 'font-size 0.2s ease-in-out', // Smooth transition for font size
    }}
    onMouseOver={(e) => {
      e.target.style.fontSize = '32px'; // Increase font size on hover
    }}
    onMouseOut={(e) => {
      e.target.style.fontSize = '30px'; // Return to original size when mouse out
    }}
  >
    Log In
  </Link>
</div>
  </div>
  );
};

export default LandingPage;
